import useCounter from '../../hooks/useCounter';
import '../02-useEffect/effects.css';

const Memorize = () => {

    useCounter(10)

    return (
        <div>
            <h1>Memorize</h1>
            <hr />
        </div>
    );
}

export default Memorize;
